/** @format */

import React, { useState } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { Link } from 'react-router-dom';
import { register } from '../actions/userActions';
import MessageBox from '../components/MessageBox';
import LoadingBox from '../components/LoadingBox';
import { USER_SAVE_REGISTER_RESET } from '../constants/userConstants';

function Register(props) {
	const [phone, setPhone] = useState('');
	const [password, setPassword] = useState('');
	const userRegister = useSelector((state) => state.userRegister);
	const { loading, userInfo, error } = userRegister;
	const dispatch = useDispatch();

	const submitHandler = (e) => {
		e.preventDefault();
		dispatch(register({ phone, password }));
		props.history.push('/user_details');
		dispatch({ type: USER_SAVE_REGISTER_RESET });
	};

	return (
		<div className="container">
			{loading ? (
				<LoadingBox></LoadingBox>
			) : (
				<div className="row mt-5 mb-5">
					<div className="col-md-3"></div>
					<div className="col-md-6">
						<div className="container card ">
							<article className="card-body ">
								<div>
									{error && <MessageBox variant="danger">{error}</MessageBox>}
									{userInfo && (
										<MessageBox variant="success">
											Registration is successful. Fill in Your Location
										</MessageBox>
									)}
									<h4 className="card-title mt-3 text-center">Create Account</h4>
									<p className="text-center">Get started with your free account</p>
									<form onSubmit={submitHandler} className="needs-validation" novalidate>
										<div className="form-group input-group" id="mobileNumber">
											<div className="input-group-prepend">
												<span className="input-group-text">
													<i className="fa fa-phone fa-flip-horizontal"></i>
												</span>
											</div>
											<input
												name=""
												className="form-control"
												placeholder="Phone number"
												type="text"
												id="validationCustom01"
												onChange={(e) => setPhone(e.target.value)}
												required
											/>
											<label for="validationCustom01" class="form-label">
												Phone Number
											</label>
										</div>
										<div className="form-group input-group" id="password">
											<div className="input-group-prepend">
												<span className="input-group-text">
													<i className="fa fa-lock"></i>
												</span>
											</div>
											<input
												className="form-control"
												placeholder="Create password"
												type="password"
												id="validationCustom02"
												onChange={(e) => setPassword(e.target.value)}
												required
											/>
											<label for="validationCustom02" class="form-label">
												Password
											</label>
										</div>
										<div className="form-group">
											<button
												type="submit"
												className="btn btn-primary btn-block"
											
											>
												Continue
											</button>
										</div>
										<p className="text-center">
											Have an account? <Link to="/">Log in</Link>
										</p>
									</form>
								</div>
							</article>
						</div>
					</div>
					<div className="col-md-3"></div>
				</div>
			)}
		</div>
	);
}

export default Register;
